- Động cơ Common rail 4JH1E4NC đạt chuẩn khí thải Euro 4, turbo tăng áp - Blue Power
- Tăng thêm nguồn điện với 2 bình ắc quy, máy mạnh hơn, tăng hiệu năng sử dụng.
- Công suất cực đại 120 PS (88kW)/ 2900rpm;
- Dung tích xy lanh 3.0L;
- Động cơ phun nhiên liệu điện tử, turbo tăng áp giúp sử dụng tối ưu nhiên liệu trong bình, không dư thừa, mang lại hiệu quả kinh tế cao, tiết kiệm nhiên liệu tối đa cho doanh nghiệp;

